class MovieCard extends React.Component{
    render(){
        return (
            <div className="main">
                <div className="movie-card">
                    <div className="left">
                        <img alt="poster" />
                    </div>
                    <div className="right">
                        <div className="title">The Avengers</div>
                        <div className="plot">SuperNatu</div>
                    </div>

                </div>
            </div>
        )       
    }
}
export default MovieCard;
